import { Component, OnInit } from '@angular/core';
import {filter, tap} from 'rxjs/operators';
import {AngularFireStorage, AngularFireUploadTask} from '@angular/fire/storage';
import {Observable} from 'rxjs';
import {AngularFirestore} from '@angular/fire/firestore';
import {LoadingController} from '@ionic/angular';

import { Camera, CameraOptions } from '@ionic-native/camera/ngx';
import { AngularFireList} from '@angular/fire/database';
import {GoogleCloudVisionServiceProvider} from '../google-cloud-vision-service.service';
import {forEach} from '@angular-devkit/schematics';
import {GoogleVisionLabelAnnotations} from '../models/GoogleVision_Models';

@Component({
  selector: 'app-vision',
  templateUrl: './vision.page.html',
  styleUrls: ['./vision.page.scss'],
})
export class VisionPage implements OnInit {


  loading: any;
  image: string;

  // annotations
  labelAnnotations: GoogleVisionLabelAnnotations[];

  items: AngularFireList<any>;

  constructor(private storage: AngularFireStorage,
              private afs: AngularFirestore,
              private camera: Camera,
              private loadingCtrl: LoadingController,
              public visionService: GoogleCloudVisionServiceProvider,
  ) {}



  ngOnInit(): void {
  }

  async presentLoading() {

    this.loading = await this.loadingCtrl.create({
      message: 'Please wait...',
      spinner: 'crescent',
      duration: 2000
    });
    return await this.loading.present();
  }

  startUpload(imageData: string) {
    this.presentLoading().then((loadingPopup) => {
      this.visionService.getLabels(imageData).subscribe((result) => {
        console.log(result);
        this.labelAnnotations = [];
        for (const response of result.responses) {
          this.labelAnnotations = response.labelAnnotations;
        }
        console.log(this.labelAnnotations);
        loadingPopup.dismiss();
      }, err => {
        console.log('error api vision');
        console.log(err.toString());
        loadingPopup.dismiss();
      });
    });
  }

  // Gets the pic from the native camera then starts the upload
  async captureAndUpload() {
    console.log('capture and upload called');

    const options: CameraOptions = {
      quality: 50,
      destinationType: this.camera.DestinationType.DATA_URL,
      encodingType: this.camera.EncodingType.JPEG,
      mediaType: this.camera.MediaType.PICTURE,
      sourceType: this.camera.PictureSourceType.CAMERA
    }

    const base64 = await this.camera.getPicture(options);
    console.log(base64);

    // tslint:disable-next-line:max-line-length
    // const base64 = '';

    this.startUpload(base64);
  }

}
